import React, { Component } from "react";

export class RegisterComponent extends Component {
    constructor(props){
        super(props)
        this.state = {
            name: "",
            email: "",
            password: "",
            password2: "",
            errors: {}
          };
    }

    componentWillReceiveProps(nextProps) {
        if (nextProps.errors) {
          this.setState({
            errors: nextProps.errors
          });
        }
      }

    render(){
        return(
            <div>
                Register Screen
            </div>
        )
    }
}
export default RegisterComponent;
